# @param {String} s
# @return {Integer}
def length_of_longest_substring(s)
  maxi = 0
  i = 0
  streak = {}
  streak_counter = 0
  while i < s.length
    if streak.key?(s[i])
      maxi = streak_counter if streak_counter > maxi
      streak_counter = 0
      i = streak[s[i]] + 1
      streak = {}
    end
    streak[s[i]] = i
    # p streak
    i += 1
    streak_counter += 1
  end
  maxi = streak_counter if streak_counter > maxi
  maxi
end

